import React from "react";
import "./App.css";

function App() {
  return (
    <div class="container">
      <div className="text-center">
        <h1>Manager</h1>
        <hr />
      </div>
      <div class="row">
        <div class="col-xs-4 col-sm-4 col-md-4 col-lg-4">{/* Form */}</div>
      </div>
    </div>
  );
}

export default App;
